actor_ladder:

sprite_ladder_size_b		equ 0x0C80	; Size in bytes
sprite_ladder_size_t		equ 0x0064	; Size in tiles
sprite_ladder_size_subsprites		equ 0x000A	; Size in subsprites
sprite_ladder_widthheight_subsprites		equ 0x0205	; Width/height (bb) in subsprites

; Subsprite offsets from 0,0 (in pixels) - unflipped (ww) and flipped X (ww)
