	dc.l 0x00200020, 0x00000020
	dc.l 0x00200040, 0x00000040
	dc.l 0x00200060, 0x00000060
	dc.l 0x00200080, 0x00000080
	Even

; Subsprite dimension bits (for sprite descs)
sprite_ladder_subsprite_dimensions_bits:
	dc.b 0xF
	dc.b 0xF
	dc.b 0xF
	dc.b 0xF
	dc.b 0xF
	dc.b 0x3
	dc.b 0x3
	dc.b 0x3
	dc.b 0x3
	dc.b 0x3
	Even

; Num tiles per subsprite (for sprite descs)
sprite_ladder_numtiles_per_subsprite:
