	dc.b 0x10
	dc.b 0x10
	dc.b 0x10
	dc.b 0x10
	dc.b 0x04
	dc.b 0x04
	dc.b 0x04
	dc.b 0x04
	dc.b 0x04
	Even


spritesheet_ladder_ladder_frameoffset	equ 0x00	; Offset to first frame in sprite sheet
spritesheet_ladder_ladder_width		equ 0x28	; Width in pixels
spritesheet_ladder_ladder_height		equ 0xA0	; Width in pixels
spritesheet_ladder_ladder_size_b		equ 0xC80	; Size in bytes
spritesheet_ladder_ladder_size_w		equ 0x640	; Size in words
spritesheet_ladder_ladder_size_l		equ 0x320	; Size in longwords
spritesheet_ladder_ladder_size_t		equ 0x64	; Size in tiles


